function GetReport(n,t,i,r){var u=GetSearchParam(n,t,i,r);HttpPost(`/ReportofLandTransferDepartmentWise/List`,"html",u,function(n){$("#LoadReportView").html("");$("#LoadReportView").html(n)})}function GetSearchParam(n,t,i,r){return{name:"test",pageSize:t,pageNumber:n,departmentid:parseInt(i),reportType:parseInt(r)}}function onPaging(n){n=parseInt(n);var t=$("#DepartmentId option:selected").val(),i=$("#ReportType option:selected").val();GetReport(currentPageNumber,currentPageSize,t,i);currentPageNumber=n}function onChangePageSize(n){n=parseInt(n);var t=$("#DepartmentId option:selected").val(),i=$("#ReportType option:selected").val();GetReport(currentPageNumber,currentPageSize,t,i);currentPageSize=n}var currentPageNumber=1,currentPageSize=10;$(function(){$("#btnGenerate").click(function(){var n=ValidateForm(),t=$("#DepartmentId option:selected").val(),i=$("#ReportType option:selected").val();n&&GetReport(currentPageNumber,currentPageSize,t,i)})});